import {Link} from 'react-router-dom'
import React from 'react'
import styled from 'styled-components'

export const Palette = {
    first : "#cce8cc",
    secondary :"#F6EFEE", 
    third : "#e2b6cf",
    fourth : "#e396df", 
    fifth : "#"

}

const StyledHeader = styled.header`
        width : 100%
`


export default function Header() {
    return (
        <StyledHeader>
            <Link to="/">Accueil</Link>
        </StyledHeader>
    )
}
